import React from 'react';
import './NewestStories.css';

function NewestStories() {
  return (
    <div className="buttons-container">
      <button className="image-button">Latest Story<br />1</button>
      <button className="image-button">Latest Story<br />2</button>
      <button className="image-button">Latest Story<br />3</button>
      <button className="image-button">Latest Story<br />4</button>
    </div>
  );
}

export default NewestStories;
